	<text transform="matrix(1 0 0 1 1265.0674 414.958)"><tspan x="0" y="0" class="st27 st598 st600">Easter is the single most im</tspan><tspan x="401.4" y="0" class="st27 st598 st600">-</tspan><tspan x="0" y="31.2" class="st27 st598 st600">portant holy day of the </tspan><tspan x="0" y="62.4" class="st27 st598 st600">Christian Church, for it cele</tspan><tspan x="405.2" y="62.4" class="st27 st598 st600">-</tspan><tspan x="0" y="93.6" class="st27 st598 st600">brates the resurrection of </tspan><tspan x="0" y="124.8" class="st27 st598 st600">Jesus Christ, the central </tspan><tspan x="0" y="156" class="st27 st598 st600">event in Christianity</tspan></text>
